First, we will simplify the expression $(3x-2)(4x+1)$ by multiplying the two binomials:

\begin{align*}
(3x-2)(4x+1) &= 3x(4x) + 3x(1) - 2(4x) - 2(1) \\
&= 12x^2 + 3x - 8x - 2 \\
&= 12x^2 - 5x - 2
\end{align*}

Next, we will simplify the expression $-(3x-2)4x+1$ by distributing the negative sign and then multiplying:

\begin{align*}
-(3x-2)4x+1 &= -4x(3x) - 4x(2) + 1 \\
&= -12x^2 - 8x + 1
\end{align*}

Now, we will substitute the simplified expressions back into the original equation:

\begin{align*}
(3x-2)(4x+1)-(3x-2)4x+1 &= (12x^2 - 5x - 2) - (12x^2 + 8x + 1) \\
&= 12x^2 - 5x - 2 - 12x^2 - 8x - 1 \\
&= -13x - 3
\end{align*}

Finally, we will substitute $x=4$ into the simplified equation:

\begin{align*}
-13x - 3 &= -13(4) - 3 \\
&= -52 - 3 \\
&= -55
\end{align*}

