\begin{align*}
\left( \frac{1}{a} + \frac{1}{b} + \frac{4}{c} + \frac{16}{d} \right) (a + b + c + d) &\ge (1 + 1 + 2 + 4)^2 \\
&= 64.
\end{align*}

Therefore, we have

\begin{align*}
\frac{1}{a} + \frac{1}{b} + \frac{4}{c} + \frac{16}{d} &\ge \frac{64}{a + b + c + d} \\
&= 64.
\end{align*}

Equality occurs when $\frac{1}{a} = \frac{1}{b} = \frac{2}{c} = \frac{4}{d}.$  Since $a + b + c + d = 1,$ we have $a = \frac{1}{9},$ $b = \frac{1}{9},$ $c = \frac{2}{9},$ and $d = \frac{4}{9}.$  Therefore, the minimum value of $\frac{1}{a} + \frac{1}{b} + \frac{4}{c} + \frac{16}{d}$ is $\boxed{64}.$

